import React, { Component } from 'react';
import Logo_mpt from '../imgs/Logo_mpt.png'

class Icono_mpt extends Component{
    render(){
        return (
            <div.img src={Logo_mpt}/>           
        );
    }
}

export default Icono_mpt;
